import { useEffect } from "react";
import react from "react";
import { useNavigate } from "react-router-dom";

export default function AddProduct() {
  const navigate = useNavigate();
  useEffect(() => {
    if (localStorage.getItem("vendor-info")) {
      navigate("/");
    }
  });
}
